import TopBar from "../../components/TopBar";
const Play = () => {
  return (
    <Container>
      <TopBar />

      <ScreenArea>
        <CoverArea>
          <Img>
            <Image source={SoundCoverImage} />
          </Img>
        </CoverArea>

        <PlayerArea>
          <PlayerTitle>Porque usar React #130</PlayerTitle>
        </PlayerArea>
      </ScreenArea>
    </Container>
  );
};

export default Play;
